% f = c1*(E/c2).^c3.*exp(-E/c2)+c4*exp((-(log10(E) - log10(c5)).^2)./(2*log10(c6).^2)) ...
%     + c7*log10(E/c8).*(1 + tanh(c9*log10(E/c10))).* ...
%     (1 - tanh(c11*log10(E/c12)));
